    @Test
    public void testMainSearchActor() {
      final TestKit testProbe = new TestKit(system);

      final ActorRef repositorySearchActor = system
          .actorOf(RepositorySearchActor.props(client, testProbe.getRef()));

      for (int i = 0; i < 2; i++) {
        final ObjectMapper mapper = new ObjectMapper();

        final ObjectNode request = mapper.createObjectNode();

        request.set("keyword", mapper.convertValue("java", JsonNode.class));

        repositorySearchActor.tell(request, ActorRef.noSender());

        testProbe.expectMsgClass(ObjectNode.class);
      }

      try {
        Thread.sleep(15000);
      } catch (InterruptedException e) {
        e.printStackTrace();
      }
    }

